description:
Get ready for the fur to fly in this wild and crazy matching game!

A flock of birds is out for revenge after a gang of cats steals their eggs! Match clusters of birds to clear a path to the hatchlings and reclaim what belongs to your finely feathered friends.

With dozens of challenging levels, colorful graphics, and a storyline that will have you squawking with laughter, Claws and Feathers will provide hours of matching fun!
